def _cython_agg_blocks(self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []

    for block in data.blocks:
        if len(block.mgr_locs) == 0:
            continue

        try:
            result, new_items, deleted_items, split_items, split_frames = self.grouper.aggregate(block.values, how, axis=1, min_count=min_count, alt=alt)
        except NotImplementedError:
            raise NotImplementedError("The aggregation function is not implemented")

        if result is not None:
            agg_blocks.append(block.make_block(result))

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    return agg_blocks, data.items
